import { FC, HTMLAttributes, useContext } from 'react'
import { LocaleContext } from '../../context/Locale'

type AvatarProps = HTMLAttributes<HTMLElement> & {}

const Avatar: FC<AvatarProps> = (props) => {
  const { className, ...otherProps } = props
  const locale = useContext(LocaleContext).locale
  return (
    <figure className={`rounded-2xl border-4 border-sky-600 ${className}`} {...otherProps}>
      <img src={imageData} className='rounded-xl m-1' width={120} alt={locale.avatar_alt} />
    </figure>
  )
}

export default Avatar

const imageData =
  'data:image/png;base64,'

